# Steppers Settings
# Supernova B0.1 - SPI Mode
# K2 350mm build with Sensorless homing on X/Y

################################
#       K2 Motor Diagram       #
################################
#              REAR
#   |------------------------|
# |-|  ----            ----  |
# |S| |Y_3 |          |X1_4| |
# |I|------            ------|
# |D|Z2 |                |Z3 |
# |E|---                  ---|
# | |                        |
# |E|---                  ---|
# |B|Z1 |                |Z  |
# |O|------            ------|
# |X| |X_2 |          |Y1_1| |
# |-|------------------------|
################################
# Underscores = Supernova Slot #
################################


##########################################
#      Stepstick slots
##########################################

# Stepper 1 on the PCB connected to Y1, front right
[stepper_y1]
step_pin: supernovaxy:gpio2
dir_pin: supernovaxy:gpio1
enable_pin: !supernovaxy:gpio3
# 20t Pulley, 2mm Pitch on a 1.8deg Motor
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400
# Sensorless homing on Y to front


# Stepper 2 on the PCB connected to X0, front left
[stepper_x]
step_pin: supernovaxy:gpio5
dir_pin: supernovaxy:gpio4
enable_pin: !supernovaxy:gpio6
# 20t Pulley, 2mm Pitch on a 1.8deg Motor
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400
# Sensorless homing on X to left
endstop_pin: tmc5160_stepper_x:virtual_endstop 
position_min: -8
position_endstop: 180
position_max: 180
homing_speed: 50.0
homing_retract_dist: 0
homing_positive_dir: true

# Stepper 3 on the PCB connected to Y0, back left
[stepper_y]
step_pin: supernovaxy:gpio11
dir_pin: !supernovaxy:gpio10
enable_pin: !supernovaxy:gpio12
# 20t Pulley, 2mm Pitch on a 1.8deg Motor
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400
endstop_pin: tmc5160_stepper_y:virtual_endstop 
position_min: -2
position_endstop: -2
position_max: 184
homing_speed: 50.0
homing_retract_dist: 0
homing_positive_dir: false

# Stepper 4 on the PCB connected to X1, back right
[stepper_x1]
step_pin: supernovaxy:gpio14
dir_pin: !supernovaxy:gpio13
enable_pin: !supernovaxy:gpio15
# 20t Pulley, 2mm Pitch on a 1.8deg Motor
rotation_distance: 40
microsteps: 32
full_steps_per_rotation: 400


